import React from "react";
import "./Hero.css";
const Hero = () => {
  return (
    <div className="hero">
      <img src="" alt="" />
      <h1><span></span>I'm Adib Kazi , frontend devloper based in PUNE</h1>
      <p>
        "I'm a frontend developer passionate about crafting engaging user
        experiences through clean, efficient code. With expertise in HTML, CSS,
        and JavaScript, I specialize in bringing designs to life while ensuring
        seamless functionality across various devices and browsers."
      </p>
      <div className="hero-action">
        <div className="hero-connect">
            Connect With Me
        </div>
        <div className="hero-resme">My resume</div>
      </div>
    </div>
  );
};

export default Hero;
